import React from 'react';
const TodoItems=(props) => {
  const {items}=props;
  console.log(items)
  const ListItems = items.map(item=>{
    return(
      <div key={item.id}>
        <p>{item.name}</p>
        <p>{item.age}</p>
        <p>&times;</p>
      </div>
    )
  })
  return (
    <div>
      list Items
      <ListItems />
    </div>
  )
}
export default TodoItems
